{"$content":[{"ID":"main_301_007_dialog_english##_00_000","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_happiness","IconLocate":2,"Text":"So is this like, the Insect Tribe's version of a rite of passage? Interesting~ I wonder if the princess also had to...","sfxName":"t0181sx_story_019","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_01_000","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_serious","IconLocate":2,"Text":"(You even supervise our ceremonies... is nothing sacred? )","sfxName":"h0183sx_story_008_a","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_02_000","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_embarrass","IconLocate":2,"Text":"Um, Princess? Princess?","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_02_001","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_embarrass","IconLocate":2,"Text":"Strange. How does a stud like me keep getting ignored...?","sfxName":"t0181sx_story_014","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_03_000","SpeakerName":"Minister","SpeakerAssetName":"CharacterName/h3435c3","IconName":"h3435c3_normal","IconLocate":2,"Text":"Esteemed guests, apologies for the long wait. Your minister shall now preside over the Metamorphosis ceremony.","sfxName":"human_male_young_soldier_01","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_03_001","SpeakerName":"Minister","SpeakerAssetName":"CharacterName/h3435c3","IconName":"h3435c3_normal","IconLocate":2,"Text":"Although the king and queen are busy with other matters, they have ordered me to offer our deepest respects to the arbiter of the Alliance and its ambassadors who have traveled so far.","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_04_000","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_sorrow","IconLocate":2,"Text":".........","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_05_000","SpeakerName":"Minister","SpeakerAssetName":"CharacterName/h3435c3","IconName":"h3435c3_normal","IconLocate":2,"Text":"Well then, let's invite up this year's group of eleven year olds.","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_06_000","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_serious","IconLocate":2,"Text":"You...","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_06_001","SpeakerName":"Faayida","SpeakerAssetName":"CharacterName/h3438c3","IconName":"h3438c3_serious","IconLocate":2,"Text":"Hmph.","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_07_000","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_embarrass","IconLocate":2,"Text":"(...Forget it. I'll give it to him after it's over.)","sfxName":"h0183sx_story_010_a","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_08_000","SpeakerName":"Minister","SpeakerAssetName":"CharacterName/h3435c3","IconName":"h3435c3_normal","IconLocate":2,"Text":"Members of the Insect Tribe and insects live in a symbiotic relationship with one another, but this choice is not yours to make. 
Only the insects know who the most suitable host for them is.","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_08_001","SpeakerName":"Minister","SpeakerAssetName":"CharacterName/h3435c3","IconName":"h3435c3_normal","IconLocate":2,"Text":"The drums have sounded, marking the time for your fated insects to come forward. Children, you are now responsible adults.","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_09_000","SpeakerName":"Insect Man","SpeakerAssetName":"CharacterName/h3436c3","IconName":"h3436c3_normal","IconLocate":2,"Text":"No!","sfxName":"human_female_young_12","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_10_000","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_surprise","IconLocate":2,"Text":"Ice-tail moths!? How could this be!","sfxName":"h0183sx_story_006_b","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_10_001","SpeakerName":"Kong Maeok","SpeakerAssetName":"CharacterName/t3407c4","IconName":"t3407c4_serious","IconLocate":2,"Text":"Juan Yun, get behind me!","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_11_000","SpeakerName":"Yu","SpeakerAssetName":"CharacterName/t3406c4","IconName":"t3406c4_serious","IconLocate":2,"Text":"Hold them off!","sfxName":"human_male_middle_soldier_05_ver2","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_11_001","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_embarrass","IconLocate":2,"Text":"Wh-What's going on? What about the ceremony?","sfxName":"t0181sx_story_018","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_11_002","SpeakerName":"Kong Maeok","SpeakerAssetName":"CharacterName/t3407c4","IconName":"t3407c4_serious","IconLocate":2,"Text":"You're too young and have never been in battle. You wouldn't know.","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_11_003","SpeakerName":"Kong Maeok","SpeakerAssetName":"CharacterName/t3407c4","IconName":"t3407c4_serious","IconLocate":2,"Text":"If a child gets picked by an ice-tail moth for symbiosis,","sfxName":"t3407c4_story_019","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_11_004","SpeakerName":"Kong Maeok","SpeakerAssetName":"CharacterName/t3407c4","IconName":"t3407c4_serious","IconLocate":2,"Text":"they become exceptionally powerful, but also callous, sociopathic—capable of destroying themselves, and others...","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_11_005","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_embarrass","IconLocate":2,"Text":"That sounds terrible...","sfxName":"t0181sx_story_026","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_11_006","SpeakerName":"Kong Maeok","SpeakerAssetName":"CharacterName/t3407c4","IconName":"t3407c4_serious","IconLocate":2,"Text":"In the past, countless members of the Alliance died at their hands. 

So, on that year, an agreement was signed forbidding any member of the Insect Tribe to undergo symbiosis with an ice-tail.","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_12_000","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_surprise","IconLocate":2,"Text":"No!","sfxName":"h0183sx_story_025_b","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_13_000","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_surprise","IconLocate":2,"Text":"What are you doing!?","sfxName":"t0181sx_story_016","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_13_001","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_sp3","IconLocate":2,"Text":"Let me go! Didn't you hear what your arbiter said!?","sfxName":"h0183sx_story_009_b","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_13_002","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_anger","IconLocate":2,"Text":"If the children merge with ice-tail moths, they'll be killed!","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_14_000","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_serious","IconLocate":2,"Text":"...*huff*...*puff*... they're all gone, but... ","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_15_000","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_serious","IconLocate":2,"Text":"No, it's already finished. They're going to hatch. Got to think of something...","sfxName":"h0183sx_story_025_b","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_16_000","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_sp5","IconLocate":2,"Text":"What are you doing!?","sfxName":"h0183sx_story_009_b","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_16_001","SpeakerName":"Faayida","SpeakerAssetName":"CharacterName/h3438c3","IconName":"h3438c3_sp1","IconLocate":2,"Text":"Agghhh!!!!","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_17_000","SpeakerName":"Yu","SpeakerAssetName":"CharacterName/t3406c4","IconName":"t3406c4_serious","IconLocate":2,"Text":"Suffering my blade, yet still alive... worthy of your reputation, ice-tail moth...","sfxName":"human_male_middle_soldier_03","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_17_001","SpeakerName":"Faayida","SpeakerAssetName":"CharacterName/h3438c3","IconName":"h3438c3_sp1","IconLocate":2,"Text":"Aghh!!! ...*sob*...*sob*...! Owww!! I want my momma... ","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_17_002","SpeakerName":"Faayida","SpeakerAssetName":"CharacterName/h3438c3","IconName":"h3438c3_sp1","IconLocate":2,"Text":"Momma, momma, momma, momma, momma...","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_18_000","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_sorrow","IconLocate":2,"Text":"No...","sfxName":"h0183sx_story_025_a","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_18_001","SpeakerName":"Faayida","SpeakerAssetName":"CharacterName/h3438c3","IconName":"h3438c3_sp1","IconLocate":2,"Text":"You! Give me my mom back!!!","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_19_000","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_serious","IconLocate":2,"Text":"Listen to me!","sfxName":"h0183sx_story_023_b","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_19_001","SpeakerName":"Faayida","SpeakerAssetName":"CharacterName/h3438c3","IconName":"h3438c3_sp1","IconLocate":2,"Text":"Let me go! Momma! I want my mommy! I want my...","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_20_000","SpeakerName":"Faayida","SpeakerAssetName":"CharacterName/h3438c3","IconName":"h3438c3_sp1","IconLocate":2,"Text":"...Momma... ","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_21_000","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_surprise","IconLocate":2,"Text":"You... he... ","sfxName":"h0183sx_story_025_a","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_21_001","SpeakerName":"Yu","SpeakerAssetName":"CharacterName/t3406c4","IconName":"t3406c4_serious","IconLocate":2,"Text":"Just shut up. The instant he got in there with that moth, there was no hope for him.","sfxName":"human_male_middle_soldier_11","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_22_000","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_sp5","IconLocate":2,"Text":"He was only a child!!!","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_23_000","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_sp5","IconLocate":2,"Text":"Let me go, or I'll—","sfxName":"h0183sx_battle_hit_01_3_strong_jp","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_23_001","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_sp1","IconLocate":2,"Text":"This is what it means to be a hostage!!","sfxName":"t0181sx_story_012","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_24_000","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_sp1","IconLocate":2,"Text":"Those were your words, princess! If you do this, many more children will die!!","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_24_001","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_sorrow","IconLocate":2,"Text":"Please... please restrain yourself... ","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_24_002","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_sp5","IconLocate":2,"Text":".........","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_25_000","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_sorrow","IconLocate":2,"Text":".........","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_25_001","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_sp4","IconLocate":2,"Text":"Princess, pardon the interruption~","sfxName":"t0181sx_story_007","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_26_000","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_surprise","IconLocate":2,"Text":"What is it? What's that you're hiding all panicked?","sfxName":"t0181sx_story_017","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_26_001","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_anger","IconLocate":2,"Text":"—It's none of your business!","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_27_000","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_sp3","IconLocate":2,"Text":"...I know you blame me for stopping you. I'm sorry.","sfxName":"t0181sx_story_029","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_27_001","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_serious","IconLocate":2,"Text":".........","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_27_002","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_sp3","IconLocate":2,"Text":"Anyway, I know you want to be alone, but I was asked by someone to give you this letter, in secret.","sfxName":"t0181sx_story_011","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_28_000","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_surprise","IconLocate":2,"Text":"...In secret?","sfxName":"h0183sx_story_005_a","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_28_001","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_happiness","IconLocate":2,"Text":"It was sent by the king and queen.","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_28_002","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_happiness","IconLocate":2,"Text":"After hearing what happened at the Metamorphosis, they wish to see you urgently, to make sure you are safe and sound.","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_28_003","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_happiness","IconLocate":2,"Text":"After all, your parents still care for you very much.","sfxName":"t0181sx_story_003_jp","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_28_004","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_serious","IconLocate":2,"Text":"......","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_29_000","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_embarrass","IconLocate":2,"Text":"So, are you going to read it?","sfxName":"t0181sx_story_017","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_29_001","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_serious","IconLocate":2,"Text":"...Did you find out why?","sfxName":"h0183sx_story_015_a","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_29_002","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_serious","IconLocate":2,"Text":"Why did all those ice-tail moths come out of nowhere like that?","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_29_003","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_embarrass","IconLocate":2,"Text":"I... I think I have found the reason... ","sfxName":"t0181sx_story_002","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_29_004","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_embarrass","IconLocate":2,"Text":"While breeding ornamental insects, an Alliance merchant unfamiliar with the Insect Tribe's ecosystem used the wrong bait...","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_29_005","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_sp1","IconLocate":2,"Text":"Ornamental insects... I'll bet it's those merchants getting rich off of war, selling us to the east, like toys...","sfxName":"h0183sx_story_010_a","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_29_006","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_embarrass","IconLocate":2,"Text":"Well, when you put it that way... But, since they're licensed merchants, Maeok decided it wasn't worth pursuing any further.","sfxName":"t0181sx_story_013","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_29_007","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_sp5","IconLocate":2,"Text":"(Our children, our lives... is it really up to you to decide whether those things are "worth pursuing"...?)","sfxName":"h0183sx_story_008_b","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_30_000","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_sp2","IconLocate":2,"Text":"You don't look so good. You must be tired. Let's just drop this topic for the time being...","sfxName":"t0181sx_story_023","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_30_001","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_sp2","IconLocate":2,"Text":"First, read the letter. I'll send someone to take you to see your parents...","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_31_000","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_sorrow","IconLocate":2,"Text":"......","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_31_001","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_sorrow","IconLocate":2,"Text":"(Father, mother... do you know how much I miss you... ?)","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_32_000","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_serious","IconLocate":2,"Text":"I can't go.","sfxName":"h0183sx_story_017_b","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_32_001","SpeakerName":"Juan Yun","SpeakerAssetName":"CharacterName/t0181","IconName":"t0181s4_surprise","IconLocate":2,"Text":"Eh? But you were so disappointed before...","sfxName":"t0181sx_story_018","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_32_002","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_serious","IconLocate":2,"Text":"I'm sorry. Please, ready my response.","sfxName":"h0183sx_story_020_a","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_32_003","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_serious","IconLocate":2,"Text":"Write that...","sfxName":"","sfxVolume":1.0},{"ID":"main_301_007_dialog_english##_33_000","SpeakerName":"Tindoiimu","SpeakerAssetName":"CharacterName/h0183","IconName":"h0183s3_serious","IconLocate":2,"Text":"Tindoiimu... has duties to attend to.","sfxName":"h0183sx_story_013_b","sfxVolume":1.0}]}
